import React from "react";
import { Box, Typography, Card, Stack } from "@mui/material";
import { useNavigate } from "react-router-dom";
import MedicalInformationIcon from '@mui/icons-material/MedicalInformation';
import MedicationLiquidTwoToneIcon from '@mui/icons-material/MedicationLiquidTwoTone';
import RamenDiningTwoToneIcon from '@mui/icons-material/RamenDiningTwoTone';



const Homepage = () => {
  const navigate = useNavigate();

  return (
    <Box sx={{ display: "flex", flexDirection: "row" }}>
      <Box p={2}>
        <Typography variant="h4" mb={2} fontWeight="bold">
          Body Mass Index Calculator
        </Typography>
        <Card
          onClick={() => navigate("/summary")}
          sx={{
            backgroundImage: "url('https://i.postimg.cc/L8q80hs7/gradient-bmi-infographic-23-2150143471.jpg')",
            backgroundSize: "cover",
            boxShadow: 2,
            borderRadius: 5,
            height: 190,
            width: 200,
            "&:hover": {
              border: 2,
              boxShadow: 0,
              borderColor: "primary.dark",
              cursor: "pointer",
            },
          }}
        >
          <MedicalInformationIcon
            sx={{ fontSize: 80, color: "primary.main", mt: 2, ml: 2 }}
          />
          <Stack p={3} pt={0}>
            <Typography fontWeight="bold" variant="h5">
             Know Your BMI
            </Typography>
            <Typography variant="h6">
            BMI is a simple measure of body weight and height,
             and it may not accurately reflect your body composition or health status.
            </Typography>
          </Stack>
        </Card>
      </Box>
      <Box p={2}>
        <Typography variant="h4" mb={2} fontWeight="bold">
          Nutri_Info
        </Typography>
        <Card
          onClick={() => navigate("/Paragraph")}
          sx={{
            boxShadow: 2,
            borderRadius: 5,
            height: 190,
            width: 200,
            "&:hover": {
              border: 2,
              boxShadow: 0,
              borderColor: "primary.dark",
              cursor: "pointer",
            },
          }}
        >
          <RamenDiningTwoToneIcon
            sx={{ fontSize: 80, color: "primary.main", mt: 2, ml: 2 }}
          />
          <Stack p={3} pt={0}>
            <Typography fontWeight="bold" variant="h5">
              Detailed Tailored Nutrients Information
            </Typography>
            <Typography variant="h6">
              Movie Recommendation By Genere
            </Typography>
          </Stack>
        </Card>
      </Box>
      <Box p={2}>
        <Typography variant="h4" mb={2} fontWeight="bold">
          Search By Prompt
        </Typography>
        <Card
          onClick={() => navigate("/chatbot")}
          sx={{
            boxShadow: 2,
            borderRadius: 5,
            height: 190,
            width: 200,
            "&:hover": {
              border: 2,
              boxShadow: 0,
              borderColor: "primary.dark",
              cursor: "pointer",
            },
          }}
        >
          <RamenDiningTwoToneIcon
            sx={{ fontSize: 80, color: "primary.main", mt: 2, ml: 2 }}
          />
          <Stack p={3} pt={0}>
            <Typography fontWeight="bold" variant="h5">
             Using Prompt
            </Typography>
            <Typography variant="h6">
              Search by prompt
            </Typography>
          </Stack>
        </Card>
      </Box>
    </Box>
  );
};

export default Homepage;
